Space Shuttle Discovery&amp;#039;s Night Launch, for Space Shuttle Mission STS-116
at Kennedy Space Center, December 9, 2006, 01:47:35 UTC.

Discovery is leaving for a 14-day (12 days actual) mission to the International Space Station, delivering a truss segment, supplies, and crew rotation.

